import { categories } from "./categorieslist";
import "./categories.css";
import React from "react";

export function Category({ categories }) {
    return (
      <ul>
        {categories.map((category) => {

          <li key={category.id}>
            {category.name}
          </li>
         })}
        <br />
      </ul>
    )
}
